import React from "react";
import axios from "axios";
import { useEffect } from "react";
import { useState } from "react";
import Main from "./main";
import './sample.css'
import { useNavigate } from "react-router";
import web from '../mac.jp'

function Admin(props){


  return(
    <div>
       <Main ad='Addcontest' page='Admin' card={<Adminmain />}  />
    </div>
  );
}


function Adminmain(props){

  
  

  const [listofpositiona, setlistofpositiona] = useState( [] );
  

  useEffect(()=>{
    axios.get("http://localhost:8000/reg/position").then((res) => {
      setlistofpositiona(res.data);
      console.log(res.data);
      
  });
},[]);
  
    return(
      <div>
         <div>
    {listofpositiona.map((value, key)=>{
      return <div style={{paddingRight:'10px' }} class="w3-col l4 m6 w3-margin-bottom">
      <div class="w3-card">
          <img src='' alt="John" style={{width:"100%"}} />
          <div class="w3-container">
              <h4>{value.description}</h4>
              <p class="w3-opacity"></p>
              <p ><button class="w3-button w3-light-grey w3-block"> View</button></p>
          </div>
      </div>
  </div>
    })}
  </div>
  );



  
      </div>
    );
  
  
  }

  export default Admin;
  export {Adminmain}
